import { _wcl } from './common-lib.js';
import { _wccss } from './common-css.js';

const defaults = {
  sound: false,
  vibrate: false
};
const booleanAttrs = ['sound', 'vibrate'];
const custumEvents = {
  click: 'msc-ripple-click'
};
const soundEffect = new Audio('data:audio/wav;base64,');

const template = document.createElement('template');
template.innerHTML = `
<style>
${_wccss}

:host {
  --msc-ripple-color: rgba(0,0,0,.15);
  --msc-ripple-timing-function: cubic-bezier(0,0,.21,1);
  --msc-ripple-duration: 1s;
  --msc-ripple-border-radius: 0px;

  inline-size: 100%;
  display: block;
}

.ripple {
  position:absolute;
  inline-size: 1000px;
  block-size: 1000px;
  background-color: var(--msc-ripple-color);
  transform: scale(0);
  opacity: 1;
  border-radius: 1000px;
  pointer-events: none;
  animation: msc-ripple-animation var(--msc-ripple-duration) var(--msc-ripple-timing-function) forwards;
}

@keyframes msc-ripple-animation {
  100% {transform:scale(1);opacity:0;}
}

.main{position:relative;inline-size:100%;overflow:hidden;border-radius:var(--msc-ripple-border-radius);transform:translate3d(0,0,0);}
.pool{position:absolute;inset-inline-start:0;inset-block-start:0;inline-size:100%;block-size:100%;pointer-events:none;}
</style>

<div class="main">
  <slot class="main__slot"></slot>
  <div class="pool"></div>
</div>
`;

// Houdini Props and Vals
if (CSS?.registerProperty) {
  CSS.registerProperty({
    name: '--msc-ripple-color',
    syntax: '<color>',
    inherits: true,
    initialValue: 'rgba(0,0,0,.1)'
  });
  
  CSS.registerProperty({
    name: '--msc-ripple-duration',
    syntax: '<time>',
    inherits: true,
    initialValue: '1s'
  });

  CSS.registerProperty({
    name: '--msc-ripple-border-radius',
    syntax: '<length>',
    inherits: true,
    initialValue: '0px'
  });
}

export class MscRipple extends HTMLElement {
  #data;
  #nodes;
  #config;

  constructor(config) {
    super();

    // template
    this.attachShadow({ mode: 'open', delegatesFocus: false });
    this.shadowRoot.appendChild(template.content.cloneNode(true));

    // data
    this.#data = {
      controller: ''
    };

    // nodes
    this.#nodes = {
      main: this.shadowRoot.querySelector('.main'),
      pool: this.shadowRoot.querySelector('.pool')
    };

    // config
    this.#config = {
      ...defaults,
      ...config // new MscRipple(config)
    };

    // evts
    this._onAnimationend = this._onAnimationend.bind(this);
    this._onClick = this._onClick.bind(this);
  }

  async connectedCallback() {
    const { main } = this.#nodes;
    const { config, error } = await _wcl.getWCConfig(this);

    if (error) {
      console.warn(`${_wcl.classToTagName(this.constructor.name)}: ${error}`);
      this.remove();
      return;
    } else {
      this.#config = {
        ...this.#config,
        ...config
      };
    }

    // upgradeProperty
    Object.keys(defaults).forEach((key) => this._upgradeProperty(key));

    // evts
    this.#data.controller = new AbortController();
    const signal = this.#data.controller.signal;
    main.addEventListener('animationend', this._onAnimationend, { signal });
    main.addEventListener('click', this._onClick, { signal, capture: true });
  }

  disconnectedCallback() {
    if (this.#data?.controller?.abort) {
      this.#data.controller.abort();
    }
  }

  _format(attrName, oldValue, newValue) {
    const hasValue = newValue !== null;

    if (!hasValue) {
      if (booleanAttrs.includes(attrName)) {
        this.#config[attrName] = false;
      } else {
        this.#config[attrName] = defaults[attrName];
      }
    } else {
      switch (attrName) {
        case 'sound':
        case 'vibrate':
          this.#config[attrName] = true;
          break;
      }
    }
  }

  attributeChangedCallback(attrName, oldValue, newValue) {
    if (!MscRipple.observedAttributes.includes(attrName)) {
      return;
    }

    this._format(attrName, oldValue, newValue);

    switch (attrName) {
      case 'sound':
        break;
      case 'vibrate':
        break;
    }
  }

  static get observedAttributes() {
    return Object.keys(defaults); // MscRipple.observedAttributes
  }

  _upgradeProperty(prop) {
    let value;

    if (MscRipple.observedAttributes.includes(prop)) {
      if (Object.prototype.hasOwnProperty.call(this, prop)) {
        value = this[prop];
        delete this[prop];
      } else {
        if (booleanAttrs.includes(prop)) {
          value = (this.hasAttribute(prop) || this.#config[prop]) ? true : false;
        } else {
          value = this.hasAttribute(prop) ? this.getAttribute(prop) : this.#config[prop];
        }
      }

      this[prop] = value;
    }
  }

  set sound(value) {
    if (value) {
      this.setAttribute('sound', '');
    } else {
      this.removeAttribute('sound');
    }
  }

  get sound() {
    return this.#config.sound;
  }

  set vibrate(value) {
    if (value) {
      this.setAttribute('vibrate', '');
    } else {
      this.removeAttribute('vibrate');
    }
  }

  get vibrate() {
    return this.#config.vibrate;
  }

  _fireEvent(evtName, detail) {
    this.dispatchEvent(new CustomEvent(evtName,
      {
        bubbles: true,
        composed: true,
        ...(detail && { detail })
      }
    ));
  }

  _onAnimationend(evt) {
    evt.target.remove();
  }

  _onClick(evt) {
    // drop useless click
    if (evt?.webkitForce === 0 || evt?.pointerType === '') {
      return
    }

    // sound
    if (this.sound) {
      soundEffect.currentTime = 0;
      soundEffect.muted = false;
      soundEffect.play();
    }

    // vibrate
    if (navigator?.vibrate && this.vibrate) {
      navigator.vibrate(100);
    }

    const ripple = document.createElement('em');
    ripple.classList.add('ripple');
    ripple.style.insetInlineStart = `${evt.offsetX - 500}px`;
    ripple.style.insetBlockStart = `${evt.offsetY - 500}px`;
    this.#nodes.pool.appendChild(ripple);

    this._fireEvent(custumEvents.click);
  }
}

// define web component
const S = _wcl.supports();
const T = _wcl.classToTagName('MscRipple');
if (S.customElements && S.shadowDOM && S.template && !window.customElements.get(T)) {
  window.customElements.define(_wcl.classToTagName('MscRipple'), MscRipple);
}